  selector: 'app-nums',
  templateUrl: './nums.component.html',
  styleUrls: ['./nums.component.css']
})
export class NumsComponent {

  @Input() value: number = 0;
values = [];
  constructor(){
    this.generateNum();
  }


  pressed() {
    console.info(this.value);
  }

  generateNum() {

    for ( let i = 0; i < 5; i++){
      const n= Math.floor(Math.random() * 30) + 1;
    this.values.push(n);
     }
     console.log(this.values);
